import React from "react";
import styled from "styled-components";

const UnOrderedList = styled.ul`
  list-style: none;
  color: #fff;
  margin: 0px;
  padding: 6px;
  li {
    width: 100%;
    cursor: pointer;
    background: #00adb5;
    line-height: 34px;
    margin: 2px;
    padding: 2px;
  }

  li:hover {
    color: #eeeeee;
  }
`;

export default function AppNavigationMenu() {
  return (
    <React.Fragment>
      <UnOrderedList>
        <li>Dashboard</li>
        <li>
          <div>Manage Assets</div>
        </li>
        <li>Accounts</li>
        <li>Contacts</li>
        <li>Active Assets</li>
        <li>Reports</li>
      </UnOrderedList>
    </React.Fragment>
  );
}
